import React, { Component } from 'react';
import { Route, Link } from "react-router-dom";
import About from './About'
import Contact from './Contact'

class App extends Component {
    render() {
        return (
          <div>
            <nav>
          {/* create nav bar here*/}
          <ul>
            <li><Link to="/about">Homepage</Link></li>
            <li><Link to="/contact">Main Blog</Link></li>
            <li><Link to="/favmovie">Favourite Movie</Link></li>
            <li><Link to="/favfood">Favourite Food</Link></li>
            <li><Link to="/about">About</Link></li>



          </ul>
        </nav>
      <main>
      	{/* create the routes; they will not appear on the page */}

      <Route path="/homepage" component = {Homepage}/>
      <Route path="/mainblog" component = {Contact}/>
      <Route path="/favmovie" component = {FavMovie}/>
      <Route path="/favfood" component = {FavoriteFood}/>
      <Route path="/about" component = {About}/>



      </main>
          </div>
        )
      }
    }
export default App;
